import axios from 'axios';
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import styled from 'styled-components';

import { fetchParticularForms } from '../utils/APIRoutes.js';
export default function Form() {
  const { id } = useParams();
  const [form, setForm] = useState([]);

  useEffect(() => {
    async function fetchForm() {
      if (id) {
        const { data } = await axios.post(fetchParticularForms, {
          surveyId: id,
        });
        if (data.status) setForm(data.response);
        console.log(form);
      }
    }
    fetchForm();
  }, [id]);
  //   console.log(form, form.length);
  return (
    <div>
      <Container>
        <div className="form">
          <div className="header">
            <h2>{form.surveyName}</h2>
          </div>
        </div>
      </Container>
    </div>
  );
}

const Container = styled.div`
  height: 100vh;
  background: red;
  padding: 3% 2%;
  display: flex;
  justify-content: center;
  .form {
    height: 100%;
    width: 500px;
    background: lime;
  }
`;
